window.bookSummaryJSON = "<p>I have battled my controlling family and won. I finally have what I want most - the wickedly sinful billionaire Henry Wolf, committed to me and within arm's reach most nights. If only it could stay that way.</p> <p>Because now I find myself caught between two titans vying for the Wolf empire, worth enough to make any moral man lethal. And Henry's brother is immoral to the bone.</p> <p>What will Henry do to save what he loves?</p> <p>And will I fall into that category?</p> <p>Contains mature themes.</p>"; 
